                {listName}
            </div>
            <div className="loadButtonHolderEmail">
                <div className="loadButtonEmail"
                    onClick={() => {
                        axios.delete(`https://emailengine2020.herokuapp.com/emailrud/${emailId}/`)
                            .then(resposnse => {
                                console.log(resposnse)

